The interface is as follows: <stepper> (valid bsl syntax) </stepper> <!-- for displaying user text in german, do -->
<stepper lang="de"> (valid bsl syntax) </stepper> Font sizes and styles are deliberately left unset wherever possible in order to just conform to the styling of the rest of the document. For the code and explanation formats, however, setting the font-family attributes is a must. The current stylesheets has chosen some specific fonts, if you do not agree with them or want to choose your own font, you simply need to override the CSS variable: .bsl-tools-stepper { --font-family-monospace: monospace; /* to use the system default */ --font-family-rule-description: "My fancy font", serif; /* to use your own choice */
} Place this somewhere where it overrides the default stylesheet that is added to the document head, e.g. in a style tag above the first stepper. Other CSS variables that can be set can be found at the head of src/ressources/small-interpreter.css .

