For the collapsible AST Production Trees, the interface in Scribble is as follows: For BSL Expressions, we use Rackets Syntax Objects, which have a similar structure as S-Expressions For other Expressions, you need to provide a JSON object with the correct structure, which will not be checked at compile-time! @bsltree[ #:quiz #t @; optional keyword argument, default is #f #:lang "de" @; optional keyword argument, default is "en" #'((valid bsl syntax))
] @jsontree[ #:quiz #t @; optional keyword argument, default is #f #:lang "de" @; optional keyword argument, default is "en"
]{ { "production": "Subtraction", "code": "(|2| - |3|)", "holes": [ { "production": "Number", "code": "2"}, { "production": "Number", "code": "3"} ] }
} It is necessary to wrap the BSL-Syntax with a #'(), especially when there are multiple <def-or-expr>, however literal values, such as 2 don't need to be wrapped. The Scribble module parses the BSL-Syntax to a string in a <bsltree> and adds the javascript module as dependency. The JSON structure for non-BSL-Syntax needs to contain a "production" name (string) some "code" (string) optionally with holes fenced by | optionally under "holes" a list of children with the same structure optionally the root node can contain a custom "grammar" as described in the html API above If you set the optional keyword argument #:quiz to #t, it will add quiz="true" which displays the tree in quiz mode. Similarly, the #:lang keyword argument can be used to set the language code. This is only applicable for Quiz mode, since the regular tree does not display any text in natural language. Currently implemented codes are en(English, default) and de(German). For the @jsontree-helper, there also is the #:extrastyle option, whose string argument will be added inside a HTML <style> tag above the HTML that is processed by the Javascript part. This way, you can override some styles, but not set CSS variables (-- will be converted to &ndash;, sadly). If, for example, your production labels are significantly larger than the text in your nodes, you can give the nodes (represented by <span> elements) greater horizontal spacing with #:extrastyle "jsontree .bsl-tools-tree span { margin-left: 2em; margin-right: 2em;}" Note that you need to scope your styles to .bsl-tools-tree, or they are less specific than those in the general stylesheet and will be overridden. Also note that inline CSS is not scoped and will apply to all your jsontree elements (or whatever you specify).
